import React, { Component }  from 'react';
import {Segment, Popup, Card} from 'semantic-ui-react';
import ArticleOne from './ConstitutionArticles/ArticleOne'
import ArticleTwo from './ConstitutionArticles/ArticleTwo'
import "../../../index.css"
import ArticleThree from './ConstitutionArticles/ArticleThree';
import ArticleFour from './ConstitutionArticles/ArticleFour';
import ArticleFive from './ConstitutionArticles/ArticleFive';
import ArticleSix from './ConstitutionArticles/ArticleSix';

export default class Constitution extends Component {


    render(){
        return(
           <Segment>
               <Popup
                    content={<ArticleOne />}
                    on='click'
                    pinned
                    trigger={<Card style={{height:"500px"}}><Card.Header>Article I. Election of Officers</Card.Header></Card>}
                >
                </Popup>
                <Popup
                    content={<ArticleTwo />}
                    on='click'
                    pinned
                    trigger={<Card><Card.Header>Article II. Duties and Powers of Officers</Card.Header></Card>}
                >
                </Popup>
                <Popup
                    content={<ArticleThree />}
                    on='click'
                    pinned
                    trigger={<Card><Card.Header>Article III. Academic Committment</Card.Header></Card>}
                >
                </Popup>
                <Popup
                    content={<ArticleFour />}
                    on='click'
                    pinned
                    trigger={<Card><Card.Header>Article IV. Amendments</Card.Header></Card>}
                >
                </Popup>
                <Popup
                    content={<ArticleFive />}
                    on='click'
                    pinned
                    trigger={<Card><Card.Header>Article V. Positions Through Applications</Card.Header></Card>}
                >
                </Popup>
                <Popup
                    content={<ArticleSix />}
                    on='click'
                    pinned
                    trigger={<Card><Card.Header>Article VI. Non-Discrimination Committment</Card.Header></Card>}
                >
                </Popup>
           </Segment>
        ) 
    }
}
